  false,\n\t\"url\": null,\n\t\"notes\": \"Towill Inc. collected LiDAR for over 3,300
  square miles in Calhoun, Aiken, Barnwell, Edgefield, McCormick, and Abbeville counties
  in South Carolina. This metadata covers the LiDAR products for Aiken County. The
  nominal pulse spacing for this project is 1.4 meters. This project was collected
  with a sensor which collects waveform data and provides an intensity value for each
  discrete pulse extracted from the waveform. GPS Week Time, Intensity, Flightline
  and echo number attributes were provided for each LiDAR point. Dewberry used proprietary
  procedures to classify the LAS according to contract specifications: 1-Unclassified,
  2-Ground, 7-Noise, 8-Model Key Points, 9-Water, 10-Ignored Ground due to breakline
  proximity. Dewberry produced 3D breaklines and combined these with the final LiDAR
  data to produce seamless hydro flattened DEMs for the 1343 tiles (5000 ft x 5000
  ft) that cover the project area.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
